  \"The status of ledge-nesting seabirds at monitoring sites in the Aleutian Islands,
  Alaska in summer 1989\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:02:43.562196\",\n\t\"name\": \"the-status-of-ledge-nesting-seabirds-at-monitoring-sites-in-the-aleutian-islands-alaska-in\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Seabird monitoring in the Aleutian Islands
  durin9 summer 1989 focused on a guild of ledge-nesting species including northern
  fulmar (Fulmarus glacialis), cormorants (Phalacrocorax spp.), kittiwakes (Rissa
  spp.), and murres (Uria spp.). The main study sites were Agattu and Buldir islands
  in the western Aleutians, but additional data were obtained in the central (Amata
  I.) and eastern (Aiktak I.) Aleutians. Results of Monitoring in 1989 suggest that
  fulmars continue to expand their nesting area at Buldir. In contrast red-faced cormorants
  (Phalacrocorax urile) may have declined at Buldir since the mid-1970s. Red-faced
  cormorants apparently had relatively poor reproductive legged (Rissa tridactyla)
  success and at Agattu in 1989. Blackred-legged kittiwakes (brevirostris) have increased
  at Buldir since the mid-1970s, but both species had poor reproductive success there
  in 1989. Interestingly, black-legged kittiwakes had better success at Agattu than
  at Buldir. Counts of black-legged kittiwakes at Agattu and Amata in 1989 were similar
  to earlier years. Common murres (Uria aalge) appear to be increasing slightly at
  Agattu since the late 1970's, and thick-billed murres (Uria lomvia) have increased
  during the same period at Buldir. Murre counts at Amata were slightly higher in
  1989 than in 1982, but at Aiktak less than 200 murres were present on cliffs in
  1989 that had contained 13,000 in 1980! Presumably this represents a seasonal absence
  not a population crash.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
